execution.script:
pipeline {
    agent any 
    environment {
        gitURL = "https://github.com/kennedd-github/agt-launch-jenkins-configuration.git"
        PERCENTC = "%"
    }

    stages {
        stage('Prepare Environment') {
            steps {
                echo 'Prepare Environment'
                script {
                    def now = new Date()
                    TIMESTAMP = now.format("yyyyMMdd_HHmmss", TimeZone.getTimeZone('GMT'))
                    BACKUP_HOME = (env.JENKINS_HOME + '\\..\\Jenkins_Backup')
                }
                echo TIMESTAMP
                echo BACKUP_HOME
                bat label: '', script: ('for /f ' + '%%f ' + ' in (\'dir /b \"' + BACKUP_HOME + '\"' + '\'' + ') do del /S /Q \"' + BACKUP_HOME + '\\%%f\"')
                bat label: '', script: ('for /f ' + '%%f ' + ' in (\'dir /b \"' + BACKUP_HOME + '\"' + '\'' + ') do rmdir /S /Q \"' + BACKUP_HOME + '\\%%f\"')
                bat label: '', script: ('mkdir ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"')
            }
        }
        stage('Clone Config From GIT') {
            steps {
                bat label: '', script: ('cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"')
                bat label: '', script: ('echo cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"' + '> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe init ' + '>> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe clone ' + env.gitURL + '>> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('@' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
            }
        }

        stage('Overwrite Clone with Current Config') {
            steps {
                bat label: '', script: ('cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"')
                bat label: '', script: ('echo cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"' + '> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo xcopy /s \"' + env.JENKINS_HOME + '\"' + ' \"agt-launch-jenkins-configuration\\Jenkins\" /E /Y /B ' + ' >> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('@' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
            }
        }

         stage('Push New Config to GIT') {
            steps {     
                bat label: '', script: ('cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\"')                
                bat label: '', script: ('echo cd ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\agt-launch-jenkins-configuration\"' + ' > ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe add . ' + '>> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe status ' + '>> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe commit -m \"Jenkins Configuration Backup ' + TIMESTAMP + '\"' + ' >> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('echo git.exe status ' + '>> ' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
                bat label: '', script: ('@' + '\"' + BACKUP_HOME + '\\' + TIMESTAMP + '\\' + 'git.bat' + '\"')
            }
        }

 /*       stage('Clone Config From GIT') {
